class Skills extends Component {
    render() {
        return (
            <div className="">
                <Container>
                    <Row>
                        <Col xs={6} md={4}>
                            <Image src="holder.js/171x180" roundedCircle />
                        </Col>
                    </Row>
                </Container>;
  </div>

        )
    }
}





export default Skills;
